class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        index = 0
        if len(s) == len(t) and s != t:
            return False
        for i in range(len(s)):
            if s[i] not in t[index:]:
                return False
            index = index + t[index:].find(s[i])+1
        
        return True
    


